import { MovieContext } from "../MovieContext";
import { useContext } from "react";
function NumResults(){
  const {movies} = useContext(MovieContext);
  return(
    <p className="num-results">
          Found <strong>{movies.length}</strong> results
        </p>
  )
}
export default NumResults;
